import{_ as t,c as o,a8 as a,o as r}from"./chunks/framework.BDnHobkS.js";const u=JSON.parse('{"title":"Переклади","description":"","frontmatter":{},"headers":[],"relativePath":"uk/contribute/translation.md","filePath":"uk/contribute/translation.md"}'),n={name:"uk/contribute/translation.md"};function i(l,e,s,c,p,d){return r(),o("div",null,e[0]||(e[0]=[a(`<h1 id="переклади" tabindex="-1">Переклади <a class="header-anchor" href="#переклади" aria-label="Permalink to &quot;Переклади&quot;">​</a></h1><p>We&#39;d love your help to translate <em>QGroundControl</em>, PX4 Metadata (in QGC), and our guides for PX4, <em>QGroundControl</em> and MAVLink!</p><p>Our docs (and <em>QGroundControl</em>) use the <a href="https://crowdin.com" target="_blank" rel="noreferrer">Crowdin</a> online tool for translation. Crowdin автоматично імпортує вихідні теми з Github і представляє нові і змінені рядки для перекладу та/або перегляду (фінального затвердження).</p><p>Crowdin експортує перекладені документи назад на Github як &quot;Pull Request&quot; (яку команда розробників періодично переглядає та приймає). Експортований вивід містить вихідний документ з будь-яким перекладом і затвердженим текстом замінено перекладеними рядками (i. . Якщо рядок не перекладений/змінений, то він буде відображатися англійською).</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>You will need a (free) <a href="https://crowdin.com/join" target="_blank" rel="noreferrer">Crowdin account</a> account to join the translation team!</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The benefit of this system is that the translation closely tracks the source documents. Читачі не будуть введені в оману через застарілі і неоновлені переклади.</p></div><h2 id="початок-роботи" tabindex="-1">Початок роботи <a class="header-anchor" href="#початок-роботи" aria-label="Permalink to &quot;Початок роботи&quot;">​</a></h2><p>Кроки з приєднання до нашої команди з перекладу такі:</p><ol><li><p>Join Crowdin: <a href="https://crowdin.com/join" target="_blank" rel="noreferrer">https://crowdin.com/join</a></p></li><li><p>Відкрийте проект, до якого хочете приєднатися:</p><ul><li><a href="https://crowdin.com/project/qgroundcontrol" target="_blank" rel="noreferrer">QGroundControl</a> — QGroundControl UI and hard coded strings.</li><li><a href="https://crowdin.com/project/px4-metadata-translations" target="_blank" rel="noreferrer">PX4-Metadata-Translations</a> — PX4 parameter and event descriptions in QGroundControl.</li><li><a href="https://crowdin.com/project/px4-user-guide" target="_blank" rel="noreferrer">PX4 User Guide</a></li><li><a href="https://crowdin.com/project/qgroundcontrol-developer-guide" target="_blank" rel="noreferrer">QGroundControl Developer Guide</a></li><li><a href="https://crowdin.com/project/qgroundcontrol-user-guide" target="_blank" rel="noreferrer">QGroundControl User Guide</a></li><li><a href="https://crowdin.com/project/mavlink" target="_blank" rel="noreferrer">MAVLink Guide</a></li></ul></li><li><p>Виберіть мову, якою ви хочете перекладати</p></li><li><p>Click the <strong>Join</strong> button (next to the text <em>You must join the translators team to be able to participate in this project</em>)</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>You will be notified once your application to join is accepted.</p></div></li></ol><p>:::</p><ol start="5"><li>Починайте перекладати!</li></ol><h2 id="особливі-примітки" tabindex="-1">Особливі примітки <a class="header-anchor" href="#особливі-примітки" aria-label="Permalink to &quot;Особливі примітки&quot;">​</a></h2><h3 id="не-змінюите-текст-префікса" tabindex="-1">Не змінюйте текст префікса! <a class="header-anchor" href="#не-змінюите-текст-префікса" aria-label="Permalink to &quot;Не змінюйте текст префікса!&quot;">​</a></h3><p>Vuepress uses <code>:::</code> to mark the beginning of notes, tips and warning:</p><div class="language-html vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">:::tip</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">The text for the tip.</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">:::</span></span></code></pre></div><p>The text for <code>:::tip</code> or <code>:::warning</code> etc. should not be modified as it defines the colour of the notebox.</p><h2 id="додавання-новоі-мови" tabindex="-1">Додавання нової мови <a class="header-anchor" href="#додавання-новоі-мови" aria-label="Permalink to &quot;Додавання нової мови&quot;">​</a></h2><p>Якщо мова, яку ви хочете перекласти, не доступна тоді вам потрібно буде запросити його звернутися до власника проекту (на головній сторінці проекту є посилання на кожен проект).</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Підтримка перекладу дуже тяжка! Перш ніж ви попросите нас створити нову мову, знайдіть кількох інших людей, щоб допомогти вам перекласти!</p></div><h2 id="отримання-допомоги" tabindex="-1">Отримання допомоги <a class="header-anchor" href="#отримання-допомоги" aria-label="Permalink to &quot;Отримання допомоги&quot;">​</a></h2><p>The <em>Crowdin</em> interface is self explanatory, but there is plenty of additional information on the <a href="https://support.crowdin.com/" target="_blank" rel="noreferrer">knowledgeable</a>.</p><p>You can also ask for help from translators and developers in the Dronecode community using <a href="./../contribute/support.html">our support channels</a>.</p>`,22)]))}const m=t(n,[["render",i]]);export{u as __pageData,m as default};
